INSERT INTO `cms_page` VALUES ('5', 'Enable Cookies', 'one_column', null, null, 'enable-cookies', null, '<div class=\"std\">\r\n    <ul class=\"messages\">\r\n        <li class=\"notice-msg\">\r\n            <ul>\r\n                <li>Please enable cookies in your web browser to continue.</li>\r\n            </ul>\r\n        </li>\r\n    </ul>\r\n    <div class=\"page-title\">\r\n        <h1><a name=\"top\"></a>What are Cookies?</h1>\r\n    </div>\r\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website. On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically whenever you visit our site so that we can personalize your experience and provide you with better service. We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes. If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\r\n    <ul class=\"disc\">\r\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\r\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\r\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\r\n        <li><a href=\"#opera\">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n</div>\r\n', '2012-05-17 03:56:34', '2012-05-17 03:56:34', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('6', 'All Products', 'three_columns', null, null, 'list-all-products', null, '<p style=\"color: #0a263c; font-size: 20px; margin-bottom: 6px;\">All Products</p>', '2012-05-18 02:58:18', '2012-06-30 03:46:36', '1', '0', '<reference name=\"content\">\r\n   <block type=\"catalog/product_allproduct\" name=\"product_allproduct\" template=\"catalog/product/list.phtml\">\r\n      <action method=\"setColumnCount\"><column_count>6</column_count></action>\r\n      <action method=\"setProductsCount\"><count>0</count></action>\r\n      <block type=\"catalog/product_list_toolbar\" name=\"product_list_toolbar\" template=\"catalog/product/list/toolbar.phtml\">\r\n         <block type=\"page/html_pager\" name=\"product_list_toolbar_pager\" />\r\n         <action method=\"setDefaultListPerPage\"><limit>5</limit></action>\r\n         <action method=\"addPagerLimit\"><mode>list</mode><limit>5</limit></action>\r\n         <action method=\"addPagerLimit\"><mode>list</mode><limit>10</limit></action>\r\n         <action method=\"addPagerLimit\"><mode>list</mode><limit>15</limit></action>\r\n         <action method=\"addPagerLimit\"><mode>list</mode><limit>20</limit></action>\r\n         <action method=\"addPagerLimit\" translate=\"label\"><mode>list</mode><limit>all</limit><label>All</label></action>\r\n      </block>\r\n      <action method=\"addColumnCountLayoutDepend\"><layout>one_column</layout><count>6</count></action>\r\n      <action method=\"setToolbarBlockName\"><name>product_list_toolbar</name></action>\r\n   </block>\r\n</reference>', null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('7', 'Contact us', 'three_columns', null, null, 'contact_us', null, '<h1>Contact us</h1>\r\n<p>Toll Free: 877.470.1875<br /> Local: 251.470.1875<br /> Fax: 251.471.5945</p>\r\n<p>Email:   <a href=\"mailto:info@fleurdeliscopperlanterns.com\">info@fleurdeliscopperlanterns.com</a></p>\r\n<p>Savannah Copper Lanterns<br /> P.O. Box 81714<br /> Mobile AL 36689</p>', '2012-05-24 03:10:30', '2012-05-24 03:10:30', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('8', 'One Year Guarantee', 'three_columns', null, null, 'one-year-guarantee', null, '<h1>One Year Guarantee</h1>\r\n<p>Fleur de Lis Copper Lanterns guarantees parts and labor for lanterns  for a period of 1 year from the date of original purchase. This warranty  does not include shipping charges incurred in returning items to Fleur  de Lis Copper Lanterns for repair or replacement.</p>\r\n<p>Terms &amp; Conditions</p>\r\n<div><ol style=\"list-style: none\">\r\n<li> All items are shipped FOB from our manufacturing facility in Mobile, AL.</li>\r\n<li> While we take great care in the packaging or our products, occasional  damage may occur. Should this be the case, any damages incurred during  shipment MUST be reported to Fleur de Lis Copper Lanterns within 24  hours of receipt of shipment.</li>\r\n<li> Design changes as well as price changes, although infrequent, are  subject to change without notice. We do, however, strive to issue prior  notification of both.</li>\r\n<li> As all our products are especially made for our customers, we must  require a 50% down payment at the time of the order with the balance due  prior to shipping.</li>\r\n<li> All merchandise is subject to applicable sales tax.</li>\r\n<li> Should any Fleur de Lis Copper Lanterns product be deemed defective  by the manufacturer, repair of replacement of the defective material is  guaranteed. This does, however, preclude installation and or other  related expenses.</li>\r\n<li> Fleur de Lis Copper Lanterns&rsquo;s handmade products adapt well to a  multitude of applications, however, no guarantee of product suitability  is provided with this offering.</li>\r\n</ol></div>', '2012-05-24 03:38:53', '2012-05-24 04:09:34', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('9', 'Shipping & Processing', 'three_columns', null, null, 'shipping-processing', null, '<h1>Shipping &amp; Processing</h1>\r\n<p>We ship via FEDEX or a specialized carrier.<br /> <br /> You MUST inspect all lanterns and items when they are delivered. The  driver will wait for this inspection and will sign off on any physical  damage noticed about the shipping container.</p>\r\n<p>Additionally you should inspect the contents of the packages and report  any damage to Fleur de Lis Copper Lanterns within 24 hours of delivery.</p>', '2012-05-24 04:14:22', '2012-05-24 04:26:18', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('10', 'Refund & Policy', 'three_columns', null, null, 'refund-policy', null, '<h1>Refund &amp; Policy</h1>\r\n<p>If you are not fully satisfied with Fleurdeliscopperlaterns\'s products,  you may return the item(s) at your expense within 10 days of receiving  the order for a full refund excluding shipping. Additionally, you may  return any defective item(s) at our expense during the same time period  as stated above for a full refund. Any item returned outside of the  above warranty period will incur a 25% restocking fee, excluding  freight. All sales are final after 30 days of physically receiving your  order.</p>', '2012-05-24 04:18:32', '2012-05-24 04:18:32', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('11', 'Security & Privacy', 'three_columns', null, null, 'security-privacy', null, '<h1>Security &amp; Privacy</h1>\r\n<p>FleurdeLis Copper Lanterns takes your privacy seriously. Our privacy  policy is clear: We will collect no personally identifiable information  about you when you visit our web site or use our services unless you  choose to provide that information to us.</p>\r\n<p><strong>What this Privacy Policy Covers </strong><br /> This Privacy Policy covers FleurdeLis Copper Lanterns treatment of  personally identifiable information that we collect when you are on the  FleurdeLisCopperLanterns.com site and when you use  FleurdeLisCopperLanterns.com\'s services. This policy does not describe  information collection policies on other sites, including those linked  to or from FleurdeLisCopperLanterns.com</p>\r\n<p><strong>What Type of Information We Collect</strong><br /> FleurdeLisCopperLanterns.com does not collect any personally  identifiable information about you other than information that you  affirmatively choose to submit to us, such as your e-mail address and  name when you subscribe to one or more of our e-mail-based newsletters.  FleurdeLisCopperLanterns.com also automatically collects aggregate  information about the use of our site, including which pages are most  frequently visited, how many visitors we receive daily, and how long  visitors stay on each page.</p>\r\n<p><strong>Cookies</strong><br /> Cookies are small pieces of information that are sent to a user\'s  Internet browser when that user accesses a Web page. The Cookie is then  saved to the user\'s hard disk so that on subsequent visits to the site  the host computer will know what information the user accessed on  previous visits and/or might want to access on future visits. FleurdeLis  Copper Lanterns may use Cookies, and use of Cookies is standard  practice for many Web sites. In fact, your browser is most likely  programmed to accept Cookies. However, if you wish to disable this  function, you can do so by de-selecting this option in your browser. To  the extent that information regarding you is available from your  Internet browser, FleurdeLis Copper Lanterns reserves the right to use  such information to record traffic and user information statistics for  the purposes of optimizing our Web site content and structure.  FleurdeLis Copper Lanterns will not share such information with a third  party. To the extent that you provide us with information regarding  yourself for purposes of receiving additional information or firm  publications, FleurdeLis Copper Lanterns will use such information only  for that purpose.</p>\r\n<p><strong>How We Use the Information We Collect</strong><br /> The personally identifiable information we collect from and about you  may be used to provide e-mail-based newsletters and other information to  you as you request and to notify you from time to time about services  offered by FleurdeLisCopperLanterns.com or other entities associated  with FleurdeLisCopperLanterns.com. We may provide personally  identifiable information we collect about you to third parties only when  such third parties desire to provide, on a limited basis, information  that may be of interest to you. We may disclose information about you if  we have a good-faith belief that we are required to do so by law or  legal process, to respond to claims, or to protect the rights, property  or safety of FleurdeLis Copper Lanterns or others.</p>\r\n<p><strong>Third-Party Traffic Analysis</strong><br /> FleurdeLisCopperLanterns.com uses a program to analyze traffic to this  web site. The program does not create individual profiles for visitors.  Unlike some tracking services it does not have a database of individual  profiles for each visitor but only collects aggregate data.</p>\r\n<p><strong>Opting-Out, Corrections and Cancellations</strong><br /> Upon request, FleurdeLis Copper Lanterns will (a) remove you and your  personal information from our database; (b) correct personal information  that you state is erroneous; or (c) permit you to \"opt out\" of further  email contact (excepting notification of major changes to the service)  while still allowing access to the site. To request a correction or  cancellation, contact us.</p>\r\n<p><strong>Changes to this Privacy Policy</strong><br /> FleurdeLis Copper Lanterns may revise and update this Privacy Policy at  any time by posting such revised Privacy Policy at  http://www.FleurdeLisLanterns.com/?page=help/privacy. Your continued  usage of FleurdeLisCopperLanterns.com will mean you accept those  changes.</p>', '2012-05-24 04:22:32', '2012-05-24 04:22:32', '1', '0', null, null, null, null, null, null);
